<br />
【JANコード】<br />
4573261090012<br />
<br />
【特徴】<br />
二酸化塩素の酸化力により、今まで消臭が困難であった排便臭や尿臭、その他悪臭にも驚くほどの消臭力を発揮し、ウイルス・菌・カビ菌に対しても除菌が効果が期待できる画期的な総合消臭除菌剤です。<br />
<br />
【安全性】<br />
二酸化塩素の安全性は厚生労働省により水道水殺菌使用等を認めています。<br />
FDA（米国食品薬品局）、EPA（米国環境保護庁）、WHO（世界保健機構）で安全性と有効性が認証されており、世界各国で幅広く使用されています。<br />
<br />
【使用方法】<br />
●専用スプレーボトルに原液を入れ、除菌・消臭したい対象物より20～30cm離して、匂いが消える程度に少量を数回に分けてスプレーして下さい。<br />
●空間消臭のご使用は、適量回数を天井に向けスプレーして下さい。<br />
●かけすぎると塩素臭が多少残る場合もあります。<br />
●汚れのある場所には、予め汚れを落としてからご使用下さい。対象物によってはシミになる恐れがあります。<br />
●包丁・まな板・食器にスプレーすることにより除菌効果が期待出来ます。尚、乾燥後、ご使用前には必ず水洗して下さい。<br />
<br />
【成分】<br />
亜塩素酸ナトリウム／二酸化塩素／安定剤（無機系）<br />
<br />
【注意事項】<br />
1)本品を直接吸い込まないで下さい。2)取り扱う際は、室内の換気を十分に行って下さい。3)本品は皮膚、目に触れないように注意して下さい。万が一目に入った場合は、速やかに流水にて15分以上洗い流し医師の診断を必ず受けて下さい。4)家電製品（エアコン・空気清浄機）等の直接噴霧は故障の原因となりますのでお控え下さい。5)本品は、金属を腐食また樹脂等を劣化させる可能性があるため、使用後は必ず水拭きして下さい。6)漂泊作用があるため、色物繊維（衣類、カーテン、じゅうたん）、革靴製品等色落ちするおそれがありますのでテストの上ご使用下さい。7)用途以外に使用しないで下さい。8)高温および直射日光を避け、暗所の涼しい所に密栓して保管して下さい。9)スプレーボトルは、専用品を使用して下さい。スプレーヘッド下に付属するストロー部分について一定期間を（ご使用条件等により異なります）経過しますと劣化によりポロポロと折れる場合がありますが、製品の品質には問題ありません。10)本液と他の薬剤とは絶対に混ぜないで下さい。11)直射日光を避け冷暗所に保管し、開封後はなるべくお早めにご使用下さい。12)本製品は医薬品でないため、臭除菌の効果効能を保障するものではありません。13)ラベルデザイン、ボトル形状、付属品について予告なく変更する場合がありますが、品質に問題はありません。<br />
<br />
【使用してはいけない所】<br />
1.人体、動物、植物への直接の使用 2.飲食品 3.色物・柄物の繊維 4.毛皮、和装品 5.錆びやすい金属6.精密機器、貴金属
