新開発の安全安心な消臭スプレー<br>
<br>
お部屋に、靴に、クルマに、ペットの臭い、タバコの臭い<br>
生活のあらゆるシーンで使える、新開発の消臭スプレーです。<br>
<br>
原材料に無機物原料を使用した産学連携による新開発の消臭スプレーです。<br>
Nattyは市販されている有機物系の消臭剤とは全く異なる方式を採用。<br>
アルミニウム、チタン、マグネシウムの分子を層状に構成させた無機物を原料としています。<br>
タバコやペット、腐敗臭等、アルカリ性、酸性の臭いを同時に抑える事が出来、一般的な有機系の消臭剤と比べ消臭効果が長時間持続する事が特徴です。<br>
<br>
また、一般的な除菌消臭剤の様に悪臭を香りで包み込むマスキング方式とは違い、Nattyは無香料で、ナノレベルの分子が臭い分子を臭いのしない分子に変えてしまいます。<br>
その為、混合臭を発生させません。<br>
<br>
●他社製品の消臭メカニズムの比較<br>
○いい匂いの香り分子で悪臭分子を包み込んで臭いをわからなくする方法<br>
欠点 ・・・<br>
基本的に悪臭分子がなくならないので、後から臭いがよみがえってきます。<br>
<br>
○酸化分解方式<br>
次亜塩素酸・安定化二酸化塩素により悪臭分子を分解してしまう方法<br>
欠点 ・・・<br>
臭いの分子を破壊しますので効果は望めますが、揮発性のため持続させるのが難しく塩素臭など薬品臭が残ります。<br>
※脱色や金属の錆など、基材の物性を変えてしまう性質があります。<br>
<br>
○吸着方式<br>
炭やゼオライト、フィルターなどに代表される様に、悪臭分子を吸着し、空気中の悪臭分子の数を減らしてしまう方法<br>
欠点 ・・・<br>
吸着する穴が埋まって行くので吸着できなくなると、あとは臭いの処理ができなくなります。<br>
※熱が加わると臭い分子を放出してしまう特性があります。<br>
<br>
○吸着浸透方式<br>
植物や穀物からの抽出液を中心に除菌成分と消臭成分が生地などに浸透し水分の蒸発に伴い効果を発揮する方法<br>
欠点 ・・・<br>
酸性あるいはアルカリ性などの単一臭気には効果が期待できますが、<br>
幅広い消臭効果と即効性に欠けます。<br>
※継続的に使用すると抽出液自体が臭いの原因になります。<br>
<br>
●高い安全性<br>
赤ちゃんからお年寄りまで、幅広い方に安心安全にお使い頂けます。<br>
<br>
《第 3 者機関での安全性テスト結果》<br>
＜危険性情報＞<br>
危険有害反応可能性 なし<br>
危険有害な分解性物質 なし<br>
<br>
＜毒性学的影響に関する情報＞<br>
急性毒性 (経口) 毒性認められず<br>
急性毒性 (経皮) 毒性認められず<br>
急性毒性 (吸入) 毒性認められず<br>
皮膚感作性 感作性なし<br>
ヒトパッチテスト 刺激性なし (皮膚炎患者群 290 人/48 時間)<br>
<br>
アンモニア臭に対する消臭率 93.2% <br>
アセトアルデヒド 98%<br>
トリメチルアミン 91%<br>
<br>
●使用上の注意<br>
冬季は車内等寒い所では、商品が凍結し成分が分離してしまい本来の消臭効果を発揮できませんのでご注意下さい。<style type="text/css">
